# Skilgreiningar

## Tekjutíund





::: {.cell}

:::





Það er fátt jafn sexý og þegar einhver talar um tekjutíundir, en hvað þýðir það? Í gögnum Hagstofunnar um tekjur eru samtals 253.683 einstaklingar árið 2023 og þau fengu samtals tekjur upp á 2.786.516 milljónir króna, eða 11 milljónir króna á mann á ári (0,9 milljónir á mánuði).

En þessir einstaklingar höfðu ekki allir sömu tekjur, heldur er tekjum dreift ójafnt. Sum hafa hærri tekjur og aðrir lægri. Ímyndum að við tökum þessa 253.683 einstaklinga, röðum þeim í vaxandi röð eftir tekjum þeirra og skiptum svo í tíu jafnstóra hópa. Þá erum við komin með það sem kallast *tekjutíundir*! Í *töflu I* að neðan sjáum við hvernig heildartekjur skiptust í tekjutíundir árið 2021.

**Hér ber að hafa í huga að allir einstaklingar sem náð hafa 16 ára aldri teljast með í þessum gögnum. Því þýða mánaðartekjur upp á 37 þúsund kr í lægstu tíundinni ekki að fjölskyldur þurfi að lifa á þeim tekjum, heldur eru þarna margir einstaklingar með engar eða mjög litlar tekjur.**





